import { createCard } from './card.js';

const main = () =>{
    const createCard = (puppylist) => {
        let puppyContainer = "";
        puppylist.map (puppy => {
            let puppyhtml =
            `<div id = "pupcard">
                <div id = "name">${puppy.name}</div>
                <div id = "idnum">${puppy.id}</div>
                <img src="${puppy.imageURL}" alt="">
                <div id = "breed">${puppy.breed}</div>
                <div id = "team">${puppy.teamId}</div>
            </div>`;
            puppyContainer = puppyhtml
        });
        pupcard.innerHTML = puppyContainer;
    }
};

createCard(fetchAllPlayers)
